def checkValidCuts(n: int, rectangles) -> bool:
    xBorderList = [[1,0] for i in range(n+1)]
    yBorderList = [[1,0] for i in range(n+1)]


    for rectangle in rectangles:
        xLow, yLow, xUp, yUp = rectangle
        for _ in range(xLow+1, xUp):
            xBorderList[_][0] = 0
        for _ in range(0, xLow+1):
            xBorderList[_][1] += 1
        for _ in range(yLow+1, yUp):
            yBorderList[_][0] = 0
        for _ in range(0, yLow+1):
            yBorderList[_][1] += 1

    xAvail = []
    yAvail = []

    for _ in range(1, n):
        if xBorderList[_][0] != 0:
            xAvail.append(_)
        if yBorderList[_][0] != 0:
            yAvail.append(_)

    if len(xAvail) >=2:
        # print("x")
        for l in range(len(xAvail)-1):
            for r in range(l+1, len(xAvail)):
                lBorder = xAvail[l]
                rBorder = xAvail[r]
                if xBorderList[0][1] > xBorderList[lBorder][1]  > xBorderList[rBorder][1] >  xBorderList[n][1]:
                    return True
    if len(yAvail) >=2:
        # print("y")
        for l in range(len(yAvail)-1):
            for r in range(l+1, len(yAvail)):
                lBorder = yAvail[l]
                rBorder = yAvail[r]
                if yBorderList[0][1] > yBorderList[lBorder][1]  > yBorderList[rBorder][1] >  yBorderList[n][1]:
                    return True

    return False


